CREATE VIEW `tec_v_kartustok`  AS SELECT `tec_kartu_stok`.`idProduk` AS `idProduk`, `tec_kartu_stok`.`tanggal` AS `tanggal`, `tec_products`.`name` AS `name`, `tec_kartu_stok`.`currentStok` AS `currentStok`, `tec_kartu_stok`.`store_id` AS `store_id`, sum(`tec_kartu_stok`.`barangMasuk` * `tec_kartu_stok`.`hargaSatuan`) AS `rpMasuk`, sum(`tec_kartu_stok`.`barangKeluar` * `tec_kartu_stok`.`hargaSatuan`) AS `rpKeluar`, sum(case when `tec_kartu_stok`.`jenisTrx` = 'PENERIMAAN' then `tec_kartu_stok`.`barangMasuk` else 0 end) AS `totalBarangMasuk`, sum(case when `tec_kartu_stok`.`jenisTrx` = 'STOKAWAL' then `tec_kartu_stok`.`barangMasuk` else 0 end) AS `totalStokAwal`, sum(case when `tec_kartu_stok`.`jenisTrx` = 'PENJUALAN' then `tec_kartu_stok`.`barangKeluar` else 0 end) AS `totalBarangKeluar`, sum(case when `tec_kartu_stok`.`jenisTrx` = 'RETUR' then `tec_kartu_stok`.`barangKeluar` else 0 end) AS `totalRetur`, sum(case when `tec_kartu_stok`.`jenisTrx` = 'WASTE' then `tec_kartu_stok`.`barangKeluar` else 0 end) AS `totalWaste`, sum(case when `tec_kartu_stok`.`jenisTrx` = 'RETURSTORE' then `tec_kartu_stok`.`barangMasuk` else 0 end) AS `totalReturStore` FROM (`tec_kartu_stok` left join `tec_products` on(`tec_products`.`id` = `tec_kartu_stok`.`idProduk`)) GROUP BY `tec_kartu_stok`.`idProduk` ;

